import"https://cdn.jsdelivr.net/npm/swiper@10/swiper-bundle.min.js";const c=document.querySelectorAll(".navbar-nav .nav-link");c.forEach(function(e){e.addEventListener("click",()=>{c.forEach(function(t){t.classList.remove("active")}),e.classList.add("active")})});window.addEventListener("scroll",function(){const e=document.querySelector(".navbar"),t=document.querySelector(".navbar-brand img"),i=window.scrollY||document.documentElement.scrollTop,n=150,o=n/2;window.innerWidth>=768&&(i>0?(e.style.height=o+"px",t.style.width=o/n*100+"%"):(e.style.height=n+"px",t.style.width="100%"))});
